import './App.css';
import { Display } from "./component/Display"
import React, { useState, useEffect } from 'react';
import axios from "axios";

function App() {
  const [data, setdata] = useState([{ name: "Sahil", age: 22, occupation: "student" }]);

  useEffect(() => {
    console.log("Started")
    axios.get("http://localhost:5000/getdata").then((item) => {
      if (item == "Not Fetched")
        console.log("Fetching data error");
      else {
        setdata(item.data);
        console.log(item.data);
        console.log(data);
        console.log("data retrieved!");
      }
    }).catch((err) => console.log(err));

  }, [])

  return (
    <div className="App">
      <h1>CRUD</h1>
      <div>

      </div>
      <div>
        {/* <Display props={ { name: "Sahil", age: 22, occupation: "student" } } /> */ }
        <Display props={ data[0] } />
        { data.map((data) => {
          < Display props={ data } />
        }) }
      </div>
    </div>
  );
}

export default App;
